import React from 'react';
import ReactDOM from 'react-dom';

const App = ()=>{
    return (
    <div> 
        <p>This is a Title</p>
        <span>This is a small amount of Text</span>
    </div>
    )
}

ReactDOM.render(
    <App/>, document.querySelector('#root')
)
